const Cards = (props) => {
  return (
    <>
      <h1>Name: {props.name}</h1>
      <h2>LastName: {props.lastName}</h2>
      <image src={props.image} />
      <p>Email: {props.email}</p>
      <p>Phone: {props.phone}</p>
    </>
  );
};

export default Cards;
